// frontend/src/AppRoutes.jsx - محدث
import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';

// Admin Pages
import AdminDashboard from './pages/admin/Dashboard';
import GamesManagement from './pages/admin/GamesManagement';
import UsersManagement from './pages/admin/UsersManagement';
import Settings from './pages/admin/Settings';
import BranchesManagement from './pages/admin/BranchesManagement';
import ActivitiesLog from './pages/admin/ActivitiesLog';
import RentalsManagement from './pages/admin/RentalsManagement';

// Employee Pages
import EmployeeDashboard from './pages/employee/Dashboard';
import Games from './pages/employee/Games'; // صفحة الألعاب للموظف
import Rentals from './pages/employee/Rentals'; // صفحة التأجيرات

// Public Pages
import Login from './pages/Login';

// Components
import ProtectedRoute from './components/ProtectedRoute';

const AppRoutes = () => {
  return (
    <Routes>
      {/* Public Routes */}
      <Route path="/login" element={<Login />} />
      
      {/* Admin Routes */}
      <Route path="/admin" element={
        <ProtectedRoute roles={['admin']}>
          <AdminDashboard />
        </ProtectedRoute>
      } />
      
      <Route path="/admin/games" element={
        <ProtectedRoute roles={['admin', 'branch_manager']}>
          <GamesManagement />
        </ProtectedRoute>
      } />
      
      <Route path="/admin/users" element={
        <ProtectedRoute roles={['admin']}>
          <UsersManagement />
        </ProtectedRoute>
      } />
      
      <Route path="/admin/settings" element={
        <ProtectedRoute roles={['admin']}>
          <Settings />
        </ProtectedRoute>
      } />
      
      <Route path="/admin/branches" element={
        <ProtectedRoute roles={['admin']}>
          <BranchesManagement />
        </ProtectedRoute>
      } />
      
      <Route path="/admin/activities" element={
        <ProtectedRoute roles={['admin']}>
          <ActivitiesLog />
        </ProtectedRoute>
      } />
      
      <Route path="/admin/rentals" element={
        <ProtectedRoute roles={['admin']}>
          <RentalsManagement />
        </ProtectedRoute>
      } />
      
      {/* Employee Routes */}
      <Route path="/employee" element={
        <ProtectedRoute roles={['employee', 'branch_manager', 'admin']}>
          <EmployeeDashboard />
        </ProtectedRoute>
      } />
      
      <Route path="/employee/games" element={
        <ProtectedRoute roles={['employee', 'branch_manager']}>
          <Games />
        </ProtectedRoute>
      } />
      
      <Route path="/employee/rentals" element={
        <ProtectedRoute roles={['employee', 'branch_manager']}>
          <Rentals />
        </ProtectedRoute>
      } />
      
      <Route path="/employee/rentals/new" element={
        <ProtectedRoute roles={['employee', 'branch_manager']}>
          <Rentals />
        </ProtectedRoute>
      } />
      
      {/* Default Route */}
      <Route path="/" element={
        <Navigate to="/login" />
      } />
      
      {/* Catch all route */}
      <Route path="*" element={<Navigate to="/login" />} />
    </Routes>
  );
};

export default AppRoutes;
